import './App.css';

export default function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
      <Route path="/service" element={<Service />} />
      <Route path="/team" element={<Team />} />

    </Routes>

    </BrowserRouter>
  );
}
